import React from "react";
import { Box, Container, Grid, Typography } from "@mui/material";

const Header = () => {
  return (
    <Container>
    <nav className="ui container center">
      <div className="ui fixed menu">
        <div className="ui container center">
          <Grid container>
        <Grid item xs={6} sm={3}>
            <Box sx={{ pb: "10px" }}>
              <Typography>
                Company
              </Typography>
              <Typography>
                About Us
              </Typography>
              <Typography>
                Contact Us
              </Typography>
            </Box>
          </Grid>
          </Grid>
        </div>
      </div>
    </nav>
    </Container>
  );
};

export default Header;
